CREATE DATABASE gambling_DB;
CREATE SCHEMA gambling;

DROP TABLE Account;

USE gambling;

CREATE TABLE Account (
      AccountNo VARCHAR(255),
      CustId INT,
      AccountLocation VARCHAR(255),
      CurrencyCode VARCHAR(255),
      DailyDepositLimit INT,
      StakeScale FLOAT,
      SourceProd VARCHAR(255)
);

